import React, { useEffect, useState } from "react"

function Gallery(props) {
    const [ filteredWallet, setFilteredWallet ] = useState([])

    useEffect(() => {
        // Filters pepes
        console.log("RUNNING")
        let cache = []
        props.wallet.forEach((asset) => {
            console.log(asset.props["series"])
            if(props.pepeFilter.fake && asset.props["series"] == "fake") {
                cache.append(asset.props)
            }
        })

        setFilteredWallet(cache)
    }, [props.pepeFilter, props.wallet])

    useState(() => {
        console.log(filteredWallet)
    }, [filteredWallet])

    return (
        <div className="gallery">
            {/* {props.wallet} */}
            {filteredWallet}
        </div>
    )
}

export default Gallery
